import './App.css';
import React, {useEffect} from 'react';




function App() {
  useEffect(() => {
    fetch("http://localhost:3000/transactions")
    .then(response => response.json())
    .then(transc => console.log(transc))
  })


  return (
    <div >

        <h1> Bank of Flatiron</h1>

    </div>
  );
}

export default App;
